import Book from './Book'

const Shelf = ({ title, books }) => {
  console.log({ books });
  return <div>
    <h1 className="bookshelf">{title}</h1>
    {books.map((book => {
        <Book book={book} />
    }))}
    </div>;
};

export default Shelf;
